function place_fumo () {
    for (let fumoValue of tiles.getTilesByType(assets.tile`myTile6`)) {
        fumo = sprites.create(assets.image`characterright`, SpriteKind.fumo)
        tiles.placeOnTile(fumo, fumoValue)
        tiles.setWallAt(fumoValue, true)
    }
}
